    "nsp-qprs",nt"isopen": false,nt"url": null,nt"notes": "NSP Quarterly
    Performance Reports (QPRs) provide information on how grantees are using NSP funds.
    QPRs contain project names, activity descriptions, project locations, national objectives,
    funds budgeted and expended, funding sources, numbers of properties and housing
    units, beginning and ending dates of activities, and numbers of low- and moderate
    income persons or households benefiting from the use of NSP funds. QPRs are submitted
    via the Disaster Recovery Grant Reporting (DRGR) System and reviewed and approved
    by HUD before posting.",nt"license_title": "License Not Specified",nt"extras":
